import React from "react";

import ICONS from "./icons";

var STEPS = {identity:[
    `After installing 1Password for Safari, it should automatically interate
    with the desktop app and unlock. If you experience 1Password stays at
    loading screen for too long, you can try these steps.`,
    `1. Make sure that you have the latest version of 1Password 8 from here:
    https://1password.com/downloads.`,
    `2. Open the 1Password desktop app > Select the three dots icon ${<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-three-dots" viewBox="0 0 16 16">
    <path d="M3 9.5a1.5 1.5 0 1 1 0-3 1.5 1.5 0 0 1 0 3zm5 0a1.5 1.5 0 1 1 0-3 1.5 1.5 0 0 1 0 3zm5 0a1.5 1.5 0 1 1 0-3 1.5 1.5 0 0 1 0 3z"/>
  </svg>} at the top left > Settings > Browser and check
    if you see this error message.`
],
Test:[],
Solution:[],
}

const Steps = () => {
    const i=STEPS.identity
    const array = i.map((step)=>(<div key={i.indexOf(step)}>
        {step}
    </div>))
return(
<div>
{array}
</div>
)
}

export default Steps
